import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { FaUsers, FaBook, FaCalendarAlt, FaComments } from 'react-icons/fa';
import Home from './Pages/Home';
import Auth from './Pages/Auth';
import Dashboard from './Pages/Dashboard';
import Profile from './Pages/Profile';
import Chat from './Pages/Chat';
import Schedule from './Pages/Schedule';
import Navbar from './components/Navbar';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        <Navbar />

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/auth" element={<Auth />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/profile" element={<Profile />} />
          <Route path="/chat" element={<Chat />} />
          <Route path="/schedule" element={<Schedule />} />
        </Routes>

        <footer className="bg-white py-6 border-t mt-12">
          <div className="max-w-7xl mx-auto px-4">
            <div className="grid grid-cols-2 md:grid-cols-4 gap-8">
              {[
                { icon: <FaUsers className="text-xl mb-2" />, title: "Find Study Partners", path: "/dashboard" },
                { icon: <FaBook className="text-xl mb-2" />, title: "Your Profile", path: "/profile" },
                { icon: <FaComments className="text-xl mb-2" />, title: "Messages", path: "/chat" },
                { icon: <FaCalendarAlt className="text-xl mb-2" />, title: "Schedule", path: "/schedule" },
              ].map((item, index) => (
                <a 
                  key={index} 
                  href={item.path}
                  className="text-center text-gray-600 hover:text-indigo-600 transition"
                >
                  <div className="flex flex-col items-center">
                    {item.icon}
                    <span>{item.title}</span>
                  </div>
                </a>
              ))}
            </div>
            <div className="mt-8 text-center text-sm text-gray-500">
              Â© {new Date().getFullYear()} StudyConnect - A University Project
            </div>
          </div>
        </footer>
      </div>
    </Router>
  );
}

export default App;
